import React, {useState} from 'react';
import logo from './logo.svg';
import CarouselOfProjects, {projectStore} from './components/CarouselOfProjects';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import ModalContent from './components/ModalContent';
import {arraySort, custom, tensorflow} from './redux/carouselReducer';




function App() {

	const [carouselItemState, setCarouselItemState] = useState({
		tensorflow:false,
		arraySort:false,
		custom:false
	});

	projectStore.subscribe(()=>{


		const name = projectStore.getState();

		switch (name){
		case tensorflow:
			console.log('name is ,', name);
			setCarouselItemState({
				tensorflow:true,
				arraySort:false,
				custom:false
			});
			break;
		case arraySort:
			setCarouselItemState({
				tensorflow:true,
				arraySort:false,
				custom:false
			});
			break;
		case custom:
			setCarouselItemState({
				tensorflow:true,
				arraySort:false,
				custom:false
			});
			break;
		default:
			setCarouselItemState({
				tensorflow:false,
				arraySort:false,
				custom:false
			});
				
		}
	});




	return (
		<div className="App">
			<ModalContent data={carouselItemState}/>
			<CarouselOfProjects />
		</div>
	);
}

export default App;
